import React, { useState } from 'react'
import axios from 'axios'

const PoliceAddForm = () => {
  const [form, setForm] = useState({
    station: '',
    type: '',
    brand: '',
    model: '',
    serial: '',
    engineNumber: '',
    frameNumber: '',
    plateNumber: '',
    color: '',
    features: '',
    complainant: '',
    dni: '',
    description: ''
  })

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value })
  }

  const handleSubmit = async e => {
    e.preventDefault()
    try {
      const token = localStorage.getItem('token')
      await axios.post('http://localhost:5000/api/objetos', form, {
        headers: { Authorization: token }
      })
      alert('Objeto registrado')
    } catch {
      alert('Error al registrar')
    }
  }

  return (
    <form onSubmit={handleSubmit} className="space-y-2">
      <h2 className="text-lg font-bold">Agregar objeto</h2>
      {Object.keys(form).map(key => (
        <input key={key} name={key} placeholder={key} onChange={handleChange} className="border p-1 w-full" />
      ))}
      <button className="bg-blue-500 text-white px-3 py-1 rounded">Registrar</button>
    </form>
  )
}

export default PoliceAddForm
